//   let num_drawn = 0;
//   while (drawpile.length != 0 && num_drawn < 3) {
//     discard.push(drawpile.shift());
//     console.log(discard[discard.length-1]);
//     num_drawn++;
//   }
//   console.log("test ", drawpile.length, discard.length);
// }

export default function Board() { // board inspired by tic tac toe tutorial
  const [cards, setCards] = useState(Array.from({length: 7},()=> Array.from({length: 13}, () => null)));
  const [face, setFace] = useState(Array.from({length: 7},()=> Array.from({length: 13}, () => null)));
  const [piles, setPiles] = useState(Array.from({length: 4},()=> Array.from({length: 13}, () => null)));
  const [start, setStart] = useState(true);
  const [drawpile, setDrawpile] = useState([]);
  const [discard, setDiscard] = useState([]);
  const [visibility, setVisibility] = useState({
    stockpile: true,
    discard1: false,
    discard2: false,
    discard3: true,
    foundation1: true,
    foundation2: true,
    foundation3: true,
    foundation4: true,
    tableau1bottom: true,
    tableau2bottom: true,
    tableau3bottom: true,
    tableau4bottom: true,
    tableau5bottom: true,
    tableau6bottom: true,
    tableau7bottom: true,
    tableau1second: false,
    tableau2second: true,
    tableau3second: true,
    tableau4second: true,
    tableau5second: true,
    tableau6second: true,
    tableau7second: true,
    tableau1third: false,
    tableau2third: false,
    tableau3third: true,
    tableau4third: true,
    tableau5third: true,
    tableau6third: true,
    tableau7third: true,
    tableau1fourth: false,
    tableau2fourth: false,
    tableau3fourth: false,
    tableau4fourth: true,
    tableau5fourth: true,
    tableau6fourth: true,
    tableau7fourth: true,
    tableau1fifth: false,
    tableau2fifth: false,
    tableau3fifth: false,
    tableau4fifth: false,
    tableau5fifth: true,
    tableau6fifth: true,
    tableau7fifth: true,
    tableau1sixth: false,
    tableau2sixth: false,
    tableau3sixth: false,
    tableau4sixth: false,
    tableau5sixth: false,
    tableau6sixth: true,
    tableau7sixth: true,
    tableau1seventh: false,
    tableau2seventh: false,
    tableau3seventh: false,
    tableau4seventh: false,
    tableau5seventh: false,
    tableau6seventh: false,
    tableau7seventh: true,
    tableau1eighth: false,
    tableau2eighth: false,
    tableau3eighth: false,
    tableau4eighth: false,
    tableau5eighth: false,
    tableau6eighth: false,
    tableau7eighth: false,
    tableau1ninth: false,
    tableau2ninth: false,
    tableau3ninth: false,
    tableau4ninth: false,
    tableau5ninth: false,
    tableau6ninth: false,
    tableau7ninth: false,
    tableau1tenth: false,
    tableau2tenth: false,
    tableau3tenth: false,
    tableau4tenth: false,
    tableau5tenth: false,
    tableau6tenth: false,
    tableau7tenth: false,
    tableau1eleventh: false,
    tableau2eleventh: false,
    tableau3eleventh: false,
    tableau4eleventh: false,
    tableau5eleventh: false,
    tableau6eleventh: false,
    tableau7eleventh: false,
    tableau1twelfth: false,
    tableau2twelfth: false,
    tableau3twelfth: false,
    tableau4twelfth: false,
    tableau5twelfth: false,
    tableau6twelfth: false,
    tableau7twelfth: false,
    tableau1thirteenth: false,
    tableau2thirteenth: false,
    tableau3thirteenth: false,
    tableau4thirteenth: false,
    tableau5thirteenth: false,
    tableau6thirteenth: false,
    tableau7thirteenth: false,
  });
  const [cardClass, setCardClass] = useState({
    stockpile: 'card2',
    discard1: 'card',
    discard2: 'card',
    discard3: 'card',
    foundation1: 'card',
    foundation2: 'card',
    foundation3: 'card',
    foundation4: 'card',
    tableau1bottom: 'card2',
    tableau2bottom: 'card',
    tableau3bottom: 'card',
    tableau4bottom: 'card',
    tableau5bottom: 'card',
    tableau6bottom: 'card',
    tableau7bottom: 'card',
    tableau1second: 'card',
    tableau2second: 'card2',
    tableau3second: 'card',
    tableau4second: 'card',
