      }
      if (!faceup) {
        return "/images/back.png";
      }
      let suit = card[card.length-1];
      let value = parseInt(card);
      let link = "/images/";
      switch(value) {
        case 1:
          link += "A";
          break;
        case 11:
          link += "J";
          break;
        case 12:
          link += "Q";
          break;
        case 13:
          link += "K";
          break;
        default:
          link += value.toString();
      }
      link += "of-";
      switch(suit) {
        case 'D':
          link += "Diamonds";
          break;
        case 'C':
          link += "Clubs";
          break;
        case 'H':
          link += "Hearts";
          break;
        case 'S':
          link += "Spades";
          break;
      }
      link += "-White.png";
      return link;
    }

